	/**
	 * 求n个数的和
	 * 
	 */
	public static int getNSum(int n) {
		int sum = 0;
		for (int i = 1; i <= n; i++) {
			sum += i;
		}
		return sum;
	}

	/**
	 * 接收控制台循环输入字符串，以"EOF"结束，返回list
	 * 
	 */
	public static List<String> getListString() {
		System.out.println("输入测试字符串，以输入EOF结束");
		Scanner scanner = new Scanner(System.in);
		List<String> list = new ArrayList<String>();
		while (scanner.hasNextLine()) {
			String string = scanner.nextLine();
			if (string.equalsIgnoreCase("EOF")) {
				break;
			} else {
				list.add(string);
			}
		}
		scanner.close();
		return list;
	}

	/**
	 * 接收控制台循环输入数字，返回数组
	 * 
	 */
	public static int[] getIntArray() {
		Scanner scanner = new Scanner(System.in);
		List<Integer> elements = new LinkedList<Integer>();
		while (scanner.hasNextInt()) {
			int element = scanner.nextInt();
			elements.add(element);
		}
		Integer[] IntegerArray = (Integer[]) elements.toArray(new Integer[0]);
		int intArray[] = new int[IntegerArray.length];
		for (int i = 0; i < IntegerArray.length; i++) {
			intArray[i] = IntegerArray[i].intValue();
		}
		scanner.close();
		return intArray;
	}

	/**
	 * 接收控制台指定测试组数，循环输入字符串，返回list
	 * 
	 */
	public static List<String> getNListString(int n) {
		Scanner scanner1 = new Scanner(System.in);
		List<String> list = new ArrayList<String>();
		for (int i = 0; i < n; i++) {
			String e = scanner1.nextLine();
			list.add(e);
		}
		scanner1.close();
		return list;
	}

	/**
	 * 数组的两个值交换位置
	 * 
	 */
	public static void swap(int[] intArray, int i, int j) {
		int temp = intArray[i];
		intArray[i] = intArray[j];
		intArray[j] = temp;
	}

	/**
	 * 接收控制台输入单个数字
	 * 
	 */
	public static int getInt() {
		Scanner scanner = new Scanner(System.in);
		int n = 0;
		if (scanner.hasNextInt()) {
			n = scanner.nextInt();
		}
		return n;
	}

	/**
	 * 输出n*n二维数组
	 * 
	 */
	public static void print2DArrary(int intArray[][]) {
		for (int i = 0; i < intArray.length; i++) {
			for (int j = 0; j < intArray.length; j++) {
				System.out.print(intArray[i][j] + " ");
			}
			System.out.println("");
		}
	}

	/**
	 * 输出一维数组
	 * 
	 */
	public static void print1DArrary(int intArray[]) {
		for (int k = 0; k < intArray.length; k++) {
			System.out.print(intArray[k] + " ");
		}
		System.out.println("");
	}

	/**
	 * 正冒泡排序，第一个数和第二个数相比较，然后交换位置，第二个数和第三个数比较，然后交换位置 ，经常
	 * 
	 */
	public static void upSort(int intArray[]) {
		int size = intArray.length;
		for (int i = 0; i < size - 1; i++) {
			for (int j = 0; j < size - 1 - i; j++) {
				if (intArray[j] > intArray[j + 1]) {// 小到大排序
					swap(intArray, j, j + 1);
				}
			}
		}
	}

	/**
	 * 正冒泡排序，第一个数和第二个数相比较，然后交换位置，第二个数和第三个数比较，然后交换位置 ，经常
	 * 
	 */
	public static void downSort(int intArray[]) {
		int size = intArray.length;
		for (int i = 0; i < size - 1; i++) {
			for (int j = 0; j < size - 1 - i; j++) {
				if (intArray[j] < intArray[j + 1]) {// 大到小排序
					swap(intArray, j, j + 1);
				}
			}
		}
	}

	/**
	 * 判断是否为质数（素数）
	 * 
	 */
	public static boolean judgePrimeNumber(int n) {
		boolean flag = true;
		for (int i = n - 1; i > 1; i--) {
			if (n % i == 0) {
				flag = false;
				break;
			}
		}
		return flag;
	}

	/**
	 * 判断是否为奇数
	 * 
	 */
	public static boolean judgeEvenNumber(int n) {
		boolean flag = false;
		if (n == 1) {
			flag = true;
		} else {
			if (n % 2 != 0) {
				flag = true;
			}
		}
		return flag;
	}

	/**
	 * 判断一个数组是否有想等的数字
	 * 
	 */
	public static boolean judgeSameNumberInArray(int intArray[]) {
		boolean flag = false;
		for (int i = 0; i < intArray.length - 1; i++) {
			for (int j = i + 1; j < intArray.length; j++) {
				if (intArray[i] == intArray[j]) {
					flag = true;
					break;
				}
			}
		}
		return flag;
	}

	/**
	 * 判断一个四位数是否有想等的数字
	 * 
	 */
	public static boolean judgeSameNumberInDigit(int n) {
		boolean flag = false;
		int intArray[] = new int[4];
		for (int i = 0; i < intArray.length; i++) {
			intArray[i] = n % 10;
			n = n / 10;
		}
		flag = judgeSameNumberInArray(intArray);
		return flag;
	}

	/**
	 * 统计一个数组中每个数的个数
	 * 
	 */
	public static void numberCount(int intArray[]) {
		for (int i = 0; i < intArray.length; i++) {
			int temp = intArray[i];
			int count = 0;
			for (int j = 0; j < intArray.length; j++) {
				if (intArray[j] == temp) {
					count++;
				}
			}
			if (count != 0) {
				System.out.println(temp + "有" + count + "个");
			}
		}
	}

