	/**
	 * 统计一个字符串中每个字符的个数,返回map
	 * 
	 */
	public static Map<String, Integer> charCountMap(String string) {
		char ch[] = string.toCharArray();
		Map<String, Integer> map = new HashMap<>();
		for (char c = 'a'; c <= 'z'; c++) {
			int count = 0;
			for (int i = 0; i < ch.length; i++) {
				if (ch[i] == c) {
					count++;
				}
			}
			if (count != 0) {
				map.put(String.valueOf(c), count); // 字符转换为字符串valueOf，放入map
			}
		}
		for (char c = 'A'; c <= 'Z'; c++) {
			int count = 0;
			for (int i = 0; i < ch.length; i++) {
				if (ch[i] == c) {
					count++;
				}
			}
			if (count != 0) {
				map.put(String.valueOf(c), count);
			}
		}
		for (char c = '0'; c <= '9'; c++) {
			int count = 0;
			for (int i = 0; i < ch.length; i++) {
				if (ch[i] == c) {
					count++;
				}
			}
			if (count != 0) {
				map.put(String.valueOf(c), count);
			}
		}
		return map;
	}

	/**
	 * 求map中value最小的值
	 * 
	 */
	public static int getMinValue(Map<String, Integer> map) {
		if (map == null)
			return 0;
		Collection<Integer> collection = map.values();
		Object[] object = collection.toArray();
		Arrays.sort(object);
		return (int) object[0];
	}

	/**
	 * 求map中value最大的值
	 * 
	 */
	public static int getMaxValue(Map<String, Integer> map) {
		if (map == null)
			return 0;
		Collection<Integer> collection = map.values();
		Object[] object = collection.toArray();
		Arrays.sort(object);
		return (int) object[object.length - 1];
	}
	
	/**
	 * 通过value找map中key的值
	 * 
	 */
	public static List<String> getKeyListByValue(Map<String, Integer> map, int value) {
		List<String> keyList = new ArrayList<String>();
		for (String key : map.keySet()) {
			if (map.get(key).equals(value)) {
				keyList.add(key);
			}
		}
		return keyList;
	}

	/**
	 * 将数字的各个位数分离，返回数组 数组存储顺序为个十百千万
	 */
	public static int[] separateNumber(String string) {
		int intArray[] = new int[string.length()];
		int n = Integer.valueOf(string);
		for (int i = 0; i < intArray.length; i++) {
			intArray[i] = n % 10;
			n = n / 10;
		}
		return intArray;
	}

